import {Container} from 'react-bootstrap';
import mainBanner from '../Banner/banner-images/mainBanner.webp'
import './Banner.css'

function Banner(){
    return(
        <Container fluid>
                <img src = {mainBanner} />
        </Container>
    )
}

export default Banner
